import React , {Component} from 'react';
import {Timeline} from 'react-twitter-widgets';
import HomeRightVideoHeighLights from './homeRightVideoHeighLights';

import '../../assets/css/home/homeRightPanel.css';

class HomeRightPanel extends Component{
    render(){
         return(
             <div>
                 <div className="card card-block mb-1">
                     {/* Code for App Download */}
                    <img className="card-img-bottom" 
                         src={require('../../assets/images/app_download.png')} alt=""/>
                        
                 </div>

                 <div className="card card-block mb-1">
                     <h5 className='card-header'>Tweets
                           <a  className='home-right-tweets-title' 
                               href="https://twitter.com/TheRealPCB"> 
                               by@TheRealPCB 
                           </a>
                      </h5>
                     
                     <div className='card-body p-1'>
                      
                         {/* <img class="card-img-top" src="..." alt="Card image cap"></img> */}

                         {/* <Timeline dataSource={{
                         sourceType:'profile',
                         screenName:'TheRealPCB'}}
                         options={{username:"TheRealPCB"}}
                         onLoad={() => console.log("Timeline is loading")}
                     />  */}

                         <a
                             className="twitter-timeline"
                             href="https://twitter.com/TheRealPCB"
                             data-tweet-limit="3"
                             data-chrome="nofooter noborders transparent noheader">
                             Tweets
                         </a>
                     </div>
                 </div>

                 <div>
                     <HomeRightVideoHeighLights />
                 </div>  
             </div>
         );
    }
}

export default HomeRightPanel;
